import React, { Component } from "react";
// This will require to npm install axios
import axios from 'axios';
import './navbar.css';
export default class Create extends Component {
  // This is the constructor that stores the data.
  constructor(props) {
    super(props);

    this.onChangePersonName = this.onChangePersonName.bind(this);
    // this.onChangePersonPosition = this.onChangePersonPosition.bind(this);
    // this.onChangePersonLevel = this.onChangePersonLevel.bind(this);
    this.onChangePersonUserName = this.onChangePersonUserName.bind(this);
    this.onChangePersonEmail = this.onChangePersonEmail.bind(this);
    this.onChangePersonPassword = this.onChangePersonPassword.bind(this);
    this.onChangePersonCity = this.onChangePersonCity.bind(this);
    this.onSubmit = this.onSubmit.bind(this);
    this.handleChange = this.handleChange.bind(this);
    this.state = {
    //   person_name: "",
    //   person_position: "",
    //   person_level: "",
    fullName: "",
    username: "",
    email: "",
    password: "",
    isManager: false,
    city: ""
    };
  }

  // These methods will update the state properties.
  onChangePersonName(e) {
    this.setState({
        fullName: e.target.value,
    });
  }

  onChangePersonUserName(e) {
    this.setState({
        username: e.target.value,
    });
  }

  onChangePersonPassword(e) {
    this.setState({
        password: e.target.value,
    });
  }

  onChangePersonEmail(e) {
    this.setState({
        email: e.target.value,
    });
  }


  onChangePersonCity(e) {
    this.setState({
      city: e.target.value,
    });
  }


  handleChange(e) {this.setState({ isManager: e.target.checked })};

// This function will handle the submission.
  onSubmit(e) {
    e.preventDefault();

    // When post request is sent to the create url, axios will add a new record(newperson) to the database.
    const newperson = {
    //   person_name: this.state.person_name,
    //   person_position: this.state.person_position,
    //   person_level: this.state.person_level,
    "fullName": this.state.fullName,
    "username": this.state.username,
    "email": this.state.email,
    "password": this.state.password,
    "isManager": this.state.isManager,
    "city": this.state.city

    };

    axios
       .post("http://localhost:4000/app/signup", newperson)
      .then((res) => console.log(res.data))
      .catch((error) => console.log(error));
    // We will empty the state after posting the data to the database
    this.setState({
    //   person_name: "",
    //   person_position: "",
    //   person_level: "",
    fullName: "",
    username: "",
    password: "",
    email: "",
    isManager: false
    });
    // {
    //     "fullName": "Naomie",
    //     "username": "joey",
    //     "email": "mail@.com",
    //     "password":"yoyo"
    // }
  }

  // This following section will display the form that takes the input from the user.
  render() {
    return (
      <div style={{ marginTop: 20 }}>
        <h3>Register</h3>
        <form onSubmit={this.onSubmit}>
          <div className="form-group">
            <label>Full Name: </label>
            <input
              type="text"
              className="form-control"
            value={this.state.fullName}
              onChange={this.onChangePersonName}
            />
          </div>
          <div className="form-group">
            <label>username: </label>
            <input
              type="text"
              className="form-control"
              value={this.state.username}
              onChange={this.onChangePersonUserName}
            />
          </div>
          <div className="form-group">
            <label>password: </label>
            <input
              type="text"
              className="form-control"
              value={this.state.password}
              onChange={this.onChangePersonPassword}
            />
          </div>
          <div className="form-group">
            <label>email: </label>
            <input
              type="text"
              className="form-control"
              value={this.state.email}
              onChange={this.onChangePersonEmail}
            />
          </div>
          <div className="form-group">
            <label>city: </label>
            <input
              type="text"
              className="form-control"
              value={this.state.city}
              onChange={this.onChangePersonCity}
            />
          </div>
          <div className="form-group">
          <label>
            <input type="checkbox" 
              checked={this.state.isManager} 
              onChange={this.handleChange} />
            <span>Manager</span>
          </label>
        </div>

          <div className="form-group">
            <input
              type="submit"
              value="Register"
              className="btn btn-primary"
            />
          </div>
        </form>
      </div>
    );
  }
}
